import {useState} from "react";
import weaponsList from '../assets/weapons.json';
import WeaponCard from "./WeaponCard";
const _ = require("lodash");

export default function Weapons() {
  
  const [currentFilter, setCurrentFilter] = useState(
    {
      power_type: "Tactical",
      limited: false,
    }
  )

  const [numberFilters, setNumberFilters] = useState(
    {
      min_power: 6000,
    }
  )

  const [currentSort, setCurrentSort] = useState(["title_req"])

  let filteredList = _.filter(weaponsList, currentFilter);
  let moreFilteredList = filteredList.filter(x => x.power > numberFilters.min_power);
  let sortedAndFilteredList = _.sortBy(moreFilteredList, currentSort);

  return(
    <>
      <div className="card-container">
        {sortedAndFilteredList.map((weapon) => (
          <WeaponCard weapon={weapon}/>
        ))}
      </div>
    </>
  );

}
